"""
1. Scenario: Function is given an empty string as input
   - Input: ""
   - Expected output: ValueError with message "Empty string was passed to the function"

2. Scenario: Function is given binary string which can be perfectly converted into octal
   - Input: "110"
   - Expected output: "6"

3. Scenario: Function is given binary string which cannot be perfectly divided into groups of three for conversion
   - Input: "1111"
   - Expected output: "17"

4. Scenario: Function is given binary string with non-binary characters
   - Input: "1234"
   - Expected output: ValueError with message "Non-binary value was passed to the function"

5. Scenario: Function is given a binary string of length 1
   - Input: "1"
   - Expected output: "1"

6. Scenario: Function is given a binary string of length 2
   - Input: "10"
   - Expected output: "2"

7. Scenario: Function is given a very long binary string
   - Input: "

"""
import pytest
from binary_to_octal import bin_to_octal

def test_empty_string():
    with pytest.raises(ValueError) as e:
        bin_to_octal("")
    assert str(e.value) == "Empty string was passed to the function", "The function should raise ValueError for empty string"

def test_binary_to_octal_conversion():
    assert bin_to_octal("110") == "6", "The function should correctly convert binary to octal"

def test_binary_string_not_divisible_by_three():
    assert bin_to_octal("1111") == "17", "The function should correctly convert binary string not divisible by three to octal"

def test_non_binary_string():
    with pytest.raises(ValueError) as e:
        bin_to_octal("1234")
    assert str(e.value) == "Non-binary value was passed to the function", "The function should raise ValueError for non-binary string"

def test_binary_string_of_length_one():
    assert bin_to_octal("1") == "1", "The function should correctly convert binary string of length one to octal"

def test_binary_string_of_length_two():
    assert bin_to_octal("10") == "2", "The function should correctly convert binary string of length two to octal"

def test_long_binary_string():
    long_binary_string = "10" * 50
    expected_octal_string = "2" * 50
    assert bin_to_octal(long_binary_string) == expected_octal_string, "The function should correctly convert long binary string to octal"
